import styled from 'styled-components'
import { IButtton } from './Button'

const bg: IButtton = {
    as: `${background}`,
}

console.log(bg)
const style = (as: any) => styled.div`
    .bg-${bg?.background}{
        background: ${bg?.as};
    }
`

export default style
